webpackJsonp([24],{"./node_modules/json-loader/index.js!./.cache/json/introducing-gatsby-material-starter.json":function(n,t){n.exports={data:{markdownRemark:{html:'<p>Not so long ago, this project got ported to v1 version of GatsbyJS.</p>\n<blockquote class="twitter-tweet" data-lang="en"><p lang="en" dir="ltr">Great news! Gatsby Material starter is now based on stable V1 of <a href="https://twitter.com/gatsbyjs">@gatsbyjs</a>!<a href="https://t.co/P2JqNbcRmk">https://t.co/P2JqNbcRmk</a></p>&mdash; Ruben Harutyunyan (@Vagr9K) <a href="https://twitter.com/Vagr9K/status/883073085963993089">July 6, 2017</a></blockquote>\n<p>And now, it\'s super exciting for me to announce the first feature rich version of <code>Gatsby Material Starter</code>!</p>\n<p>New features are:</p>\n<ul>\n<li>Blazing fast loading times thanks to prerendered HTML and automatic chunk loading of JS files</li>\n<li>\n<p><a href="https://github.com/mlaursen/react-md">React-MD</a> for Material design</p>\n<ul>\n<li>Integrated FontAwesome support</li>\n<li>Integrated Material Icons support</li>\n</ul>\n</li>\n<li>SASS/SCSS styling</li>\n<li>Separate components for everything</li>\n<li>\n<p>High configurability:</p>\n<ul>\n<li>User information</li>\n<li>User social profiles</li>\n<li>Copyright information</li>\n<li>More!</li>\n</ul>\n</li>\n<li>\n<p>Author segment</p>\n<ul>\n<li>Name</li>\n<li>Location</li>\n<li>Description</li>\n<li>Links</li>\n<li>Follow Me button</li>\n</ul>\n</li>\n<li>\n<p>Posts in Markdown</p>\n<ul>\n<li>Code syntax highlighting</li>\n<li>Embded YouTube videos</li>\n<li>Embded Tweets</li>\n</ul>\n</li>\n<li>\n<p>Tags</p>\n<ul>\n<li>Seprate page for posts under each tag</li>\n</ul>\n</li>\n<li>\n<p>Categories</p>\n<ul>\n<li>Separate page for posts under each category</li>\n</ul>\n</li>\n<li>\n<p>Disqus support</p>\n<ul>\n<li>Notifictions about new disqus comments</li>\n</ul>\n</li>\n<li>Google Analytics support</li>\n<li>\n<p>Responsive design</p>\n<ul>\n<li>On mobile, Disqus is loaded only after expanding comments for better performance</li>\n</ul>\n</li>\n<li>NPM scripts for GitHub Pages deployment</li>\n<li>\n<p>Social features</p>\n<ul>\n<li>Twitter tweet button</li>\n<li>Facebook share/share count</li>\n<li>Reddit share/share count</li>\n<li>Google+ share button</li>\n<li>LinkedIn share button</li>\n<li>Telegram share button</li>\n</ul>\n</li>\n<li>\n<p>SEO</p>\n<ul>\n<li>Sitemap generation</li>\n<li>robots.txt</li>\n<li>General description tags</li>\n<li>Schema.org JSONLD (Google Rich Snippets)</li>\n<li>OpenGraph Tags (Facebook/Google+/Pinterest)</li>\n<li>Twitter Tags (Twitter Cards)</li>\n</ul>\n</li>\n<li>RSS feeds</li>\n<li>Loading progress for slow networks</li>\n<li>Offline support</li>\n<li>Web App Manifest support</li>\n</ul>\n<p>More information is available on <a href="https://github.com/Vagr9K/gatsby-material-starter">GitHub repository page</a>.</p>',timeToRead:2,excerpt:"Not so long ago, this project got ported to v1 version of GatsbyJS. And now, it's super exciting for me to announce the first feature rich...",frontmatter:{title:"Introducing Gatsby Material Starter",cover:"/logos/logo-1024.png",date:"18/07/2017",category:"gatsby",tags:["gatsby","material","starter"]}}},pathContext:{slug:"/Introducing-Gatsby-Material-Starter/"}}}});
